import React from 'react';
import Card from './Card'

const CardList = ({robots}) => {
    const cardComponent = robots.map((user, i) => {
        return <Card key={i} id={user[i].id} name={user[i].name} email={user[i].email}/>
    })
    return(
        <div>
            {cardComponent}
         </div>
    )
}
export default CardList
